import React, {useState} from "react";


const customInput = () => {


    return(
        <>
            <form className='form'>
                <div>

                    <input type='text' placeholder='search' required></input>
                    <button type='submit' className='btn'>Search</button>
                </div>
                    <lable>Published between</lable>
                <div className='form-control'>
                    <lable htmlFor='to'>To:</lable>
                    <input type='datetime' id='to'></input>
                    <lable htmlFor='for'>From:</lable>
                    <input type='datetime-local' id='for'></input>
                </div>
            </form>
        </>
    );

}

export default customInput;
